import React from 'react';
import Todos from './components/Todos';
import './App.css';

class App extends React.Component {

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <p>Hello World</p>
          <Todos />
        </header>
      </div>
  )};
}

export default App;

//funtion component = stateless component / no lifecycle methods
